import React from 'react'

function Home() {
  return (
    <div>
      <ul>
        <li style={{
          listStyle: 'none',
          paddingLeft: 20,
          paddingRight: 20,
          paddingTop: 15,
          paddingBottom: 15,
          background: 'red',
          width: 100,
        }}><a href='#' style={{
          paddingLeft: 20,
          paddingRight: 20,
          paddingTop: 15,
          paddingBottom: 15,
          background: 'yellow',
        }}>Home</a></li>
      </ul>
    </div>
  )
}

export default Home
